 "Enter an RSS URL for the RSS feed you \nwant to attach to your content. Feeds are often identified by a small graphic\n icon (often like this <img src=\"\/images\/feed-icon.png\" \/>) or the text \"RSS\". Clicking on the \n icon or text label will display an RSS feed right in your browser. You can copy and paste the\nURL into this field. Alternately, right clicking on the link or graphic will open a menu box;\nclick on COPY LINK LOCATION or Copy Shortcut. Back in eXe open the RSS bookmark iDevice and Paste the URL \ninto the RSS URL field and click the LOAD button. This will extract the titles from your feed and\ndisplay them as links in your content. From here you can edit the bookmarks and add\n instructions or additional learning information.": "Introduzca el URL del RSS del canal RSS que\nquiere agregar al contenido. Los marcadores son com\u00fanmente identificados por un icono peque\u00f1o \n (com\u00fanmente como este <img src=\"\/images\/feed-icon.png\" \/>)  o el texto \"RSS\". Pulsando en el icono \no en el texto se mostrar\u00e1 el marcador RSS en su navegador. \nPuede copiar y pegar el URL del RSS en este campo. Alternativamente, puede hacer clic derecho en el v\u00ednculo o gr\u00e1fico y se abrir\u00e1 un men\u00fa; \npulse en Copiar direcci\u00f3n del enlace o Copiar acceso directo. Regrese a eXe y pegue el v\u00ednculo en el \ncampo URL del iDevice RSS y pulse en el bot\u00f3n Subir. Este extraer\u00e1 los t\u00edtulos de su canal RSS y\nlos mostrar\u00e1 como v\u00ednculos en el contenido. Desde aqu\u00ed puedes editar los favoritos y agregar \ninstrucciones o informaci\u00f3n adicional de aprendizaje.", 
