 "When building an MCQ consider the following: <ul>\n<li> Use phrases that learners are familiar with and have \nencountered in their study <\/li>\n<li> Keep responses concise <\/li>\n<li> There should be some consistency between the stem and the responses <\/li>\n<li> Provide enough options to challenge learners to think about their response\n<\/li>\n<li> Try to make sure that correct responses are not more detailed than the \ndistractors <\/li>\n<li> Distractors should be incorrect but plausible <\/li>\n<\/ul>\n": "Cuando construya una pregunta de selecci\u00f3n m\u00faltiple considere lo siguiente: <ul>\n<li>Use frases que a los estudiantes les sean conocidas \no que hayan encontrado en su estudio <\/li>\n<li> Mantenga concisas las respuestas <\/li>\n<li> Debe haber una cierta relaci\u00f3n entre la pregunta y las respuestas <\/li>\n<li> Proporcione suficientes opciones para obligar a los estudiantes a pensar sus respuestas\n<\/li>\n<li>Aseg\u00farese de que las respuestas correctas no sean m\u00e1s detalladas que las \nincorrectas<\/li>\n<li>Las incorrectas deben ser lo m\u00e1s cre\u00edbles posible<\/li>\n<\/ul>\n", 
