 "Teachers should keep the following in mind when using this iDevice: <ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "Los Profesores deben recordar lo siguiente cuando est\u00e9n usando este iDevice<ol><li>Piense en la cantidad de diferentes tipos de actividades planificados como recurso los cuales ser\u00e1n se\u00f1alado visualmente como contenido. Trate de no usar demasiados tipos de clasificaci\u00f3n diferentes de actividades para que el estudiante no se confunda. Normalmente tres o cuatro tipos diferentes son m\u00e1s que suficientes para un recurso de aprendizaje.<\/li><li>Desde una perspectiva de dise\u00f1o visual, trate no de no tener dos iDevices pegados sin texto entre ellos. Si esto es necesario, es mejor hacer los dos preguntas o eventos en otro iDevice.<\/li><li>Motive al estudiante a realizar la actividad haci\u00e9ndole saber que resultar\u00e1<\/li><\/ol>", 
